&lt;p&gt;Just a short video of me and my brother Jay with daughter Candace at a Padres baseball game.&lt;br /&gt;
&lt;br /&gt;
Jay (who lives in Salt Lake City, Utah) has some kind of tradition with fellow southwest airline employee friends where they fly to a different city each year around Sept 11 to go to a baseball game. This year they came to San Diego so Candace and I were able to join him.&lt;br /&gt;
&lt;br /&gt;
This Petco Park baseball stadium was recently built, it's the first time we've been inside for a game. It's part of this 'revitalization' of downtown, part of the Downtown re-developement. As areas of Downtown get rundown after 100 years or so of existence they are being rebuilt to attract people to come back to enjoy the heart of the city center. So this Baseball stadium is designed really nice to be right in the middle of downtown in the old style of baseball parks from many years ago.&lt;br /&gt;
&lt;br /&gt;
(The video was made with the front side camera of my iphone which is low-resolution compared to the much better back side camera)&lt;/p&gt;

